    useEffect(() => {
        const url = 'http://localhost:4000//get-likeProducts:'+userId;
        axios.get(url)
            .then((res) => {
                console.log(res) ;
                // if (res.data.products) {
                //     setproducts(res.data.products);
                // }
            })
            .catch((err) => {
              
                alert('server error');
            })
    }, []) ; 


